import { StatusBar } from 'expo-status-bar';
import React, { useState } from 'react';
import { StyleSheet, Text, View, TextInput, Button, Alert } from 'react-native';

export default function App() {

  const [num1, setNum1] = useState('');
  const [num2, setNum2] = useState('');

  const buttonPressedSum = () => {
    var sum = num1 + num2;
    Alert.alert('You want to sum ' + sum);
  }

  const buttonPressedSub = () => {
    Alert.alert('You want to sub ' + num1 + ' & ' + num2);
  }

  return (
    <View style={styles.container}>
        <Text>Calculator</Text>
        <StatusBar style="auto" />
        <Text>Result: </Text>
        <TextInput
          style={{width: 200, borderColor: 'blue', borderWidth: 1}}
          onChangeText={num1 => setNum1(num1)}
          value={num1}
          keyboardType='numeric'
        />
        <TextInput
          style={{width: 200, borderColor: 'blue', borderWidth: 1}}
          onChangeText={num2 => setNum2(num2)}
          value={num2}
          keyboardType='numberic'
        />
        <Button onPress={buttonPressedSum} title="+" />
        <Button onPress={buttonPressedSub} title="-" />
    </View>
  );
}



const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
